@ShawnFumo @drjwrae @peteskomoroch I think there are two parts to this:
- Lossy Database: you give in a prompt (query) and it returns an image (value).  The bigger the models the better it gets.
- Encrypted Lossy Database: you give a prompt (public key) and diffusion settings (incl. seed) and it returns an image.

